script: |
  super -f text -I q11735.spq | sort > q11735.out

inputs:
  - name: q11735.spq
    data: |
      SELECT ALL col1 / - 48 * - - col1 + + col2 + col0 * 54 * - 85 * + CAST ( NULL AS INTEGER ) AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE ( - 28 ) NOT BETWEEN - col0 - + + col0 + + col2 * + + 74 * - 40 * - col1 * + - 68 AND NULL;
  - name: tab0

outputs:
  - name: q11735.out
    data: |
